import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <h1>Books Store</h1>

        <div className="Card">
          <div className="card_detail">
            <img src="https://eloquentjavascript.net/img/cover.jpg" alt="image" className="card_img"/>
            <p className="card_title">Eloquent JavaScript, Second Edition</p>
            <span className="card_author">Marijn Haverbeke</span>
            <a href="http://eloquentjavascript.net/" target="blank">
              <button>Buy Now</button>
            </a>
          </div>    
        </div>


  </React.StrictMode>
);
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitalsnpm cache clean --forcein
reportWebVitals();
